// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;
contract Notes{
    struct Note{
         string note;
         address uid;
    }
    Note[] public notes;
    function createNote(string memory _note) public{   
        notes.push(Note(_note,msg.sender));
    }
    function getNotes() public view returns(Note[] memory){   
        return notes;   
    }
}
